import { getRandomInt } from "./Random.js";

const FOOD_TYPES = {
  common: {
    type: "common",
    cost: 1,
  },
  rare: {
    type: "common",
    cost: 1,
  },
  common: {
    type: "common",
    cost: 1,
  },
};

export const createFood = (boardSize = 0) => {
  const cord = { x: getRandomInt(boardSize), y: getRandomInt(boardSize) };
  console.log(cord);
  return { ...cord, ...FOOD_TYPES.common };
};
